<?php

use Illuminate\Database\Seeder;

class Hotels_imagesTableSeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
      foreach (range(1, 4) as $num) {
          DB::table('hotels_images')->insert([
              'id' => $num,
              'image_url' => "data:image/jpeg;base64,",
              'hotels_id' => $num,     
          ]);
      }
    }
}
